import React from "react";


export default class AllListItems extends React.Component{
render()
{ console.log("productlist")

    return (
        <div>              
        {this.props.tasks.map(function(task, index){
            return(            
            <div key={index} className='task-wrapper flex-wrapper'>{task.title}</div>
            
            )
          })}
        </div>  
     )

}
}
